import React, { useContext, useEffect, useState } from 'react';
import StarWarsContext from '../context/StarwarsContext';

function Table() {
  const { filter } = useContext(StarWarsContext);
  const [table, setTable] = useState([]);

  useEffect(() => {
    setTable(filter);
  }, [filter]);

  return (
    <table>
      <thead>
        <tr>
          <th>name</th>
          <th>rotation period</th>
          <th>orbital period</th>
          <th>diameter</th>
          <th>climate</th>
          <th>gravity</th>
          <th>terrain</th>
          <th>surface water</th>
          <th>population</th>
          <th>Films</th>
          <th>Created</th>
          <th>Edited</th>
          <th>URL</th>
        </tr>
      </thead>
      <tbody>
        {table.length > 0 && table.map((ele, k) => (
          <tr key={ k }>
            <td>{ ele.name }</td>
            <td>{ ele.rotation_period }</td>
            <td>{ ele.orbital_period }</td>
            <td>{ ele.diameter }</td>
            <td>{ ele.climate }</td>
            <td>{ ele.gravity }</td>
            <td>{ ele.terrain }</td>
            <td>{ ele.surface_water }</td>
            <td>{ ele.population }</td>
            <td>{ ele.films.map((e) => (e)) }</td>
            <td>{ ele.created }</td>
            <td>{ ele.edited }</td>
            <td>{ ele.url }</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default Table;
